import LoginLayout from "../Layout/LoginLayout";
import FindLocationLayout from "../Layout/FindLocationLayout";
import Login from "../../pages/Login";

export const routes = [
  {
    path: '/login',
    component: Login,
    layout: LoginLayout
  },
  {
    path: '/',
    component: import('../../pages/FindLocation'),
    layout: FindLocationLayout
  },
  {
    path: '/home',
    component: import('../../pages/FindLocation'),
  }
]
